import React from 'react';
import video from '../assets/Images/Home_vid.webm'

const Home = () => {
  return (
    <div style={{ display: 'flex' }}>
      <div style={{ flex: 1 }}>
        <h1>Welcome to Pillar Watch</h1>
        <p>Discover the latest in Pillar watches.</p>
      </div>
      <div style={{ flex: 1, display: 'flex', justifyContent: 'center', alignItems: 'center' }}>
        <div style={{ width: '50%', paddingBottom: '50%', position: 'relative' }}>
          <div style={{ position: 'absolute', width: '100%', height: '50%', top: 0, left: 0, borderBottomLeftRadius: '50%', borderBottomRightRadius: '50%', overflow: 'hidden' }}>
            <iframe
              title="Pillar Watch Video"
              style={{ position: 'absolute', width: '100%', height: '200%', top: '-50%', left: 0 }}
              src={video}
              frameBorder="0"
              allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture"
              allowFullScreen
            ></iframe>
          </div>
        </div>
      </div>
    </div>
  );
};


export default Home;
